class Field extends Component {
  render() {
    const holder = 'Enter here';
    const styledField = {
      width: '300px'
    };
    return <input 
    placeholder={holder} 
    type='text' 
    style={styledField}/>
  }
}

function Btn() {


  const text = 'Log in';
  const logged = false;


  return <button>{logged ? 'Enter' : text}</button>
}

function App() {
  return (
    <div className="App">
      <StrictMode>
        <Header />
      </StrictMode>
      <Field />
      <Btn />
    </div>
  );
}

export {Header};
export default App;
